On PyPy `__Pyx_GetItemInt_Fast` ends up as (there's a big `ifdef` block which is dropped in PyPy)

```
static CYTHON_INLINE PyObject *__Pyx_GetItemInt_Fast(PyObject *o, Py_ssize_t i, int is_list,
                                                     CYTHON_NCP_UNUSED int wraparound,
                                                     CYTHON_NCP_UNUSED int boundscheck) {
    if (is_list || PySequence_Check(o)) {
        return PySequence_GetItem(o, i);
    }
    return __Pyx_GetItemInt_Generic(o, PyInt_FromSsize_t(i));
}
```

and `__Pyx_GetItemInt_Generic` is just

```
static PyObject *__Pyx_GetItemInt_Generic(PyObject *o, PyObject* j) {
    PyObject *r;
    if (unlikely(!j)) return NULL;
    r = PyObject_GetItem(o, j);
    Py_DECREF(j);
    return r;
}
```

I think `PySequence_Check` should pass and it'll call `PySequence_GetItem`. When you write `__getitem__` Cython defines both `sq_item` and `mp_subscript` which both point at the `__getitem__` method. Therefore, `PySequence_GetItem` calls your `__getitem__` method via `sq_item`.

Even if `PySequence_Check` fails, it'll go through `PyObject_GetItem` (which also calls your `__getitem__` method, this time through `mp_subscript` I think).

(As an aside, there's room for improvement in Cython's here since it does some unnecessary conversions to Python integers in some cases, although not yours).

~The upshot of all of this is that I'm relatively sure the logic is OK and that this is a PyPy bug.
So it's probably best reported there. @mattip - any thoughts?~  Ignore this - changed my mind

Cython is probably missing a test here however.
